(610, 'l', '', '', '', 'Fecha entrega documento apostillado', 'Oscar Gámez', '2019-10-14 06:37:20', NULL, 191, 'finalizada', 'Los trámites de Oscar Gámez, fueron una estafa. Luego de pagarle $ 150.00 + $ 100.00, sale con la excusa de que Alejandra estaba registrada en la página del MPPRE y que hacía falta recuperar su contraseña. Hablécon Rayza Romero y tiene una amiga que nos puede ayudar.', '2019-10-18 09:30:00', '2019-11-05 06:09:21', '0000-00-00 00:00:00', '2019-11-05 06:14:10', NULL),
